const GroupButton = () => {
return (
    <Component>
        <StyledButton onClick={() => handleDecrement()} disabled={counter == 0}>-</StyledButton>
        <Button disabled>{counter}</Button>
        <StyledButton onClick={() => handleIncrement()}>+</StyledButton>
    </Component>
);

}
export default GroupButton;
